import PauseButton from "./pauseButton"
import PlayButton from "./playButton"
import ResumeButton from "./resumeButton"



function SongCard(props) {

    function keyPrint(e) {
        console.log(`now printing for array placement ${e.target.value
            }`)
    }

    return (
        <div className="card" key={props.id}>
            <div className="card-body">
                <p className="card-text">name: {props.name}</p>
                {/* <p className="card-text">album: {props.album}</p> */}
                <p className="card-text">artist: {props.artist}</p>
            </div>
            <div>
                <button className="btn btn-primary" value={props.key} onClick={keyPrint()}>Play</button>
                {/* <PlayButton song={props.uri} />
                <PauseButton />
                <ResumeButton /> */}
            </div>
        </div>

    )
}


export default SongCard
